// ModalComponent.js
import React from 'react';
import Modal from 'react-modal';

const ModalCampoObligatorio = ({ isOpen, closeModal }) => {
  return (
    <Modal
      isOpen={isOpen}
      onRequestClose={closeModal}
      contentLabel="Campos Obligatorios"
    >
      <h2>Llena los campos obligatorios</h2>
      <button onClick={closeModal}>Cerrar</button>
    </Modal>
  );
};

export default ModalCampoObligatorio ;
